import React from 'react';
import { skycon } from './skycon';

const WeatherIconTwo = props => {
  if (!props.icon) {
    return `Loading...`;
  }

  console.log(props.icon);

  return (
    <div>
      <canvas id="partly-cloudy-day"></canvas> {props.icon}
    </div>
  );
};

export default WeatherIconTwo;
